import React from "react";
import "./styles.css";
import { Table, Col, Row } from 'reactstrap';

export default class App extends React.Component {
  state = {
    data: []
  };

  componentDidMount() {
    const urlFetch = fetch("https://reqres.in/api/users?page=2");
    urlFetch
      .then(res => {
        if (res.status === 200) return res.json();
      })
      .then(resJson => {
        this.setState(
          {
            data: resJson.data
          }
        );
      });
  }
  render() {
    return (
      <div className="container-fluid">
        <h1 className="h3 mb-4 text-gray-800">Daftar Pengguna</h1>
        <Row>
          <Col md="12">
            <Table>
              <thead>
                <tr>
                  <th>#</th>
                  <th>First Name</th>
                  <th>Last Name</th>
                  <th>Username</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <th scope="row">1</th>
                  <td>Mark</td>
                  <td>Otto</td>
                  <td>@mdo</td>
                </tr>
                <tr>
                  <th scope="row">2</th>
                  <td>Jacob</td>
                  <td>Thornton</td>
                  <td>@fat</td>
                </tr>
                <tr>
                  <th scope="row">3</th>
                  <td>Larry</td>
                  <td>the Bird</td>
                  <td>@twitter</td>
                </tr>
              </tbody>
            </Table>
          </Col>
        </Row>
      </div>
    );
  }
}
